    false,nt"url": null,nt"notes": "This annual narrative report for Flint
    Hills National Wildlife Refuge summarizes activities during the 1990 calendar year.
    The report begins with an introduction to the refuge and a summary of the year's
    highlights and climatic conditions. The report includes a planning section which
    discusses management plans and research and investigations. Refuge administration
    is outlined; information about personnel, youth programs, manpower programs, volunteer
    programs, funding, safety, and other items is given.  Habitat management is also
    covered. Subjects include wetlands, forests, cropland, grasslands, grazing, haying,
    fire management, pest control and water rights. The wildlife section of the report
    discusses endangered and threatened species, waterfowl, marsh and waterbirds, shorebirds,
    gulls, terns and allied species, raptors, other migratory species, game mammals,
    other resident wildlife, fisheries resources, and scientific collections. The public
    uses of the refuge described in this report include outdoor student classrooms,
    interpretive foot trails, interpretive exhibits/demonstrations, hunting, fishing,
    trapping, wildlife observation, other wildlife oriented recreation, picnicking,
    other non-wildlife oriented recreation, and law enforcement. The equipment and facilities
    section of the report provides information about new construction, rehabilitation,
    major maintenance, equipment utilization and replacement, communications systems,
    and computer systems. Items of interest are provided at the end.",nt"license_title":
